import React from 'react';
import { AppBar, Typography } from '@material-ui/core';
import { Tabs, Tab } from '@material-ui/core';

function LinkTab(props) {
  return <Tab component="a" onClick={event => event.preventDefault()} {...props} />;
}

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: 8 * 3 }}>
      {props.children}
    </Typography>
  );
}

const Header = (props) => {
  const value = props.value;
  const handler = props.handleChange;
  return (
    <div>
    <AppBar position="static">
      <Paper>
      <Typography color="inherit" variant="h6">
      Shree Silks
      </Typography>
      </Paper>
      <Tabs value={value} onChange={handler}>
        <LinkTab label="Page One" href="page1" />
        <LinkTab label="Page Two" href="page2" />
        <LinkTab label="Page Three" href="page3" />
      </Tabs>
    </AppBar>
    {value === 0 && <TabContainer>Page One</TabContainer>}
    {value === 1 && <TabContainer>Page Two</TabContainer>}
    {value === 2 && <TabContainer>Page Three</TabContainer>}
    </div>
  );
}

export default Header;
